import { faChartLine , faFileCircleCheck , faBan , faHandshake} from "@fortawesome/free-solid-svg-icons";

export let CardData = [
   {
       title: 'Open permits',
       color: '#cbf078',
       icons: 'faChartLine'

   },
   {
       title: 'Open extended',
       color: '#c4c1e0',
       icons: 'faFileCircleCheck'
   },
   {
       title: 'Closed permits',
       color: '#ffcbcb',
       icons: 'faHandshake'
   },
   {
       title: 'Hold permits',
       color: ' #d9b650',
       icons: 'faBan'
   },
   {
       title: 'Rejected permits',
       color: ' #d9b650'
   },
   {
       title: 'Total permits',
       color: ' #d9b650'
   }
]
